import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

function Header() {
    const [isScrolled, setIsScrolled] = useState(false);
    const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
    const { isAuthenticated, userRole, logout } = useAuth();
    const navigate = useNavigate();

    useEffect(() => {
        const handleScroll = () => {
            setIsScrolled(window.scrollY > 20);
        };
        window.addEventListener('scroll', handleScroll);
        return () => window.removeEventListener('scroll', handleScroll);
    }, []);

    const handleLogout = () => {
        logout();
        navigate('/login');
    };

    return (
        <header className={`header ${isScrolled ? 'scrolled' : ''}`}>
            <div className="container">
                <nav className="nav-container">
                    <Link to="/" className="logo">
                        <span className="logo-text gradient-text">CarPark</span>
                    </Link>

                    <button 
                        className={`mobile-menu-toggle ${isMobileMenuOpen ? 'active' : ''}`}
                        onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
                        aria-label="Toggle menu"
                    >
                        <span></span>
                        <span></span>
                        <span></span>
                    </button>

                    <div className={`nav-menu ${isMobileMenuOpen ? 'active' : ''}`}>
                        <div className="nav-links">
                            <Link to="/search" className="nav-link hover-lift">
                                <i className="fas fa-search"></i>
                                Find Parking
                            </Link>
                            {isAuthenticated && (
                                <>
                                    <Link to={`/${userRole}/dashboard`} className="nav-link hover-lift">
                                        <i className="fas fa-columns"></i>
                                        Dashboard
                                    </Link>
                                    <Link to="/bookings" className="nav-link hover-lift">
                                        <i className="fas fa-ticket-alt"></i>
                                        My Bookings
                                    </Link>
                                    <Link to="/vehicles" className="nav-link hover-lift">
                                        <i className="fas fa-car"></i>
                                        My Vehicles
                                    </Link>
                                </>
                            )}
                        </div>

                        <div className="auth-buttons">
                            {isAuthenticated ? (
                                <button onClick={handleLogout} className="btn btn-outline">
                                    <i className="fas fa-sign-out-alt"></i>
                                    Logout
                                </button>
                            ) : (
                                <>
                                    <Link to="/login" className="btn btn-outline">
                                        <i className="fas fa-sign-in-alt"></i>
                                        Login
                                    </Link>
                                    <Link to="/register" className="btn btn-primary">
                                        <i className="fas fa-user-plus"></i>
                                        Register
                                    </Link>
                                </>
                            )}
                        </div>
                    </div>
                </nav>
            </div>
        </header>
    );
}

export default Header;
